import React from 'react';

import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TableRow from '@mui/material/TableRow';
import Paper from '@mui/material/Paper';

import edit from '../../assets/images/icons/Vector.svg';
import close from '../../assets/images/icons/Delete.svg';

function createData(name, store, address, category, date, price, remains, weight) {
	return { name, store, address, category, date, price, remains, weight };
}

const rows = [
	createData('Sneakers', 'Adidas', 'Krylatskaya st...', 'Sportswear', '05.07.2021', '$1 000', 40, '5kg'),
	createData('Ice cream sandwich', 237, 9.0, 37, 4.3),
	createData('Eclair', 262, 16.0, 24, 6.0),
	createData('Cupcake', 305, 3.7, 67, 4.3),
	createData('Gingerbread', 356, 16.0, 49, 3.9),
];

const ProductTable = () => {
	return (
		<div className="product_table">
			<TableContainer component={Paper}>
				<Table sx={{ minWidth: 650 }} aria-label="simple table">
					<TableHead>
						<TableRow>
							<TableCell>Product name</TableCell>
							<TableCell align="right">Store</TableCell>
							<TableCell align="right">Address</TableCell>
							<TableCell align="right">Category</TableCell>
							<TableCell align="right">Creation date</TableCell>
							<TableCell align="right">Price</TableCell>
							<TableCell align="right">Remains</TableCell>
							<TableCell align="right">Weight / Volume</TableCell>
							<TableCell align="right">Actions</TableCell>
						</TableRow>
					</TableHead>
					<TableBody>
						{rows.map((row) => (
							<TableRow
								key={row.name}
								sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
							>
								<TableCell component="th" scope="row">
									{row.name}
								</TableCell>
								<TableCell align="right">{row.store}</TableCell>
								<TableCell align="right">{row.address}</TableCell>
								<TableCell align="right">{row.category}</TableCell>
								<TableCell align="right">{row.date}</TableCell>
								<TableCell align="right">{row.price}</TableCell>
								<TableCell align="right">{row.remains}</TableCell>
								<TableCell align="right">{row.weight}</TableCell>
								<TableCell align="right">
									<div className="btn">
										<span>Sell</span>
									</div>
									<div className="btn">
										<img src={edit} alt="Edit"/>
									</div>
									<div className="btn">
										<img src={close} alt="Close"/>
									</div>
								</TableCell>
							</TableRow>
						))}
					</TableBody>
				</Table>
			</TableContainer>
		</div>
	);
};

export default ProductTable;
